import logo from './logo.svg';
import './App.css';

import Cabecera from '../Biblioteca/Ejercicio 1/Cabecera';
import Menu from './Biblioteca/Ejercicio 1/Menu';
import PiePagina from './Biblioteca/Ejercicio 1/PiePagina';
import Contenedor from './Biblioteca/Ejercicio 1/Contenedor';
import Informacion from './Biblioteca/Ejercicio 1/Informacion';
import Peliculas from './Biblioteca/Ejercicio 2/Peliculas';


function App() {
  return (
    <React.Fragment>
    <Contenedor>
        <Cabecera titulo="PELIS.COM"></Cabecera>
        <Menu></Menu>
        <Informacion>
          <Peliculas/>
        </Informacion>
        <PiePagina correo="ejemplo@gmail.com" telefono="910101010" ciudad="Elda(Alicante)"></PiePagina>
      </Contenedor>
</React.Fragment>

  );
}

export default App;
